  "Allegations" : "S-18-2404-18-CO01 - Bayhill Advisors, Inc. and Michael Tumer - Consent Order  On November 9, 2018, the Securities Division entered into a Consent Order with Respondents Bayhill Advisors, Inc. and Michael Tumer. In the Consent Order, the Securities Division alleged that the Respondents violated the Securities Act by acting as an investment adviser and/or an investment adviser representative while not registered to do so. Without admitting or denying the Securities Division's allegations, Respondents agreed to cease and desist from violations of RCW 21.20.040, the registration provisions of the Securities Act. Respondents Bayhill Advisors, Inc. and Michael Tumer agreed to pay a fine of $20,000. Respondents Bayhill Advisors, Inc. and Michael Tumer waived their right to a hearing and judicial review of the matter.",
